syntax = "proto3";

option java_package = "emu.grasscutter.net.proto";

import "Vector.proto";

// Name: HDKIFBIDOBJ
message EvtRushMoveInfo {
    Vector pos = 1;
    Vector MCOJDHHIFCH = 2;
    int32 state_name_hash = 9;
    uint32 entity_id = 6;
    float time_range = 14;
    Vector NMOLBICBICJ = 11;
    int32 face_angle_compact = 8;
    Vector velocity = 13;
}

